    @media(min-width: 768px) {
        font-size: 4.5rem;
    }

}

.heading-tertiary {
    font-size: 2.2rem;
    font-weight: 400;

    @media(min-width: 768px) {
        font-size: 2.4rem;
    }

}

sources.scss/abstracts/_mixins.scss:
@mixin center {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
}

@mixin underline {
    &::after {
        content: '';
        display: block;
        margin: 2rem auto;
        height: 2px;
        width: 12rem;
        background-color: #777;
        @media(min-width: 768px) {
            margin: 3rem auto;
        } 
    }
}

@mixin clearfix {
    &::after {
        content: '';
        display: block;
        clear: both;
    }
}

sources.scss/base/_grid.scss:
.row {
    max-width: 114rem;
    margin: 0 auto;
    @include clearfix;

    @media(min-width: 768px) {
        display: table;
    }

    [class^='col-'] {
        @media (min-width: 768px) {
            width: calc(50% - #{$gutter-vertical});
            float: left;
        }
    }

}

sources.scss/components/_button.scss:
.btn {

    &,
    &:link,
    &:visited {
        position: relative;
        display: inline-block;
        text-decoration: none;
        font-size: 1.8rem;
        color: $color-white;
        background-color: $color-black-0;
        padding: 1.5rem 4rem;
        border: 1px solid $color-black-0;
        border-radius: 10rem;
        box-shadow: 0 1rem 2rem rgba($color-black, .17);
        transition: all .2s;
        margin-top: 2.2rem;

        @media(min-width: 768px) {
            font-size: 2rem;
        }
    }

    &::after {
        position: absolute;
        top: 0;
        left: 0;
        display: block;
        content: '';
        height: 100%;
        width: 100%;
        border-radius: 10rem;
        z-index: -100;
        transition: all 400ms;   
        color: inherit;
        background: inherit;     
    }

    &:hover {
        transform: translateY(-3px);
        box-shadow: 0 2rem 3rem rgba($color-black, .17);

        &::after {
            transform: scaleX(1.4) scaleY(1.6);
            opacity: 0;
        }

    }

    &:active {
        transform: translateY(-1px);
        box-shadow: 0 1rem 2rem rgba($color-black, .17);
    }

    &__hire {

        &:link,
        &:visited {
            opacity: .7;
            color: $color-white;
            border: 1px solid $color-white;
            background-color: transparent;
        }
    }

}

sources.scss/components/_navigation.scss:
.navigation {

    &__checkbox {
        display: none;
    }

    &__button {
        position: fixed;
        top: 1.5rem;
        right: 1.5rem;
        height: 5rem;
        width: 5rem;
        text-align: center;
        background-color: $color-white;
        border-radius: 50%;
        z-index: 300;
        box-shadow: 0 1rem 3rem rgba($color-black, .2);
        cursor: pointer;

        @media(min-width: 768px) {
            top: 4rem;
            right: 4rem;
            height: 7rem;
            width: 7rem;
        }

    }

    &__background {
        position: fixed;
        top: 2rem;
        right: 2rem;
        height: 3rem;
        width: 3rem;
        border-radius: 50%;
        background: $color-black-0;
        background-size: cover;
        background-position: center;
        z-index: 100;
        transition: all 800ms cubic-bezier(0.86, 0, 0.07, 1);

        @media(min-width: 768px) {
            top: 4.5rem;
            right: 4.5rem;
            height: 6rem;
            width: 6rem;
        }


    }

    &__nav {
        position: fixed;
        top: 0;
        left: 0;
        height: 100vh;
        opacity: 0;
        width: 0;
        visibility: hidden;
        z-index: 200;
        transition: all 800ms cubic-bezier(0.68, -0.55, 0.265, 1.55);
    }

    &__list {
        @include center;
        text-align: center;
        width: 100%;
        list-style: none;
    }

    &__item {
        margin: 1rem;
    }

    &__link {

        &:link,
        &:visited {
            display: inline-block;
            padding: 1rem 2rem;
            text-transform: uppercase;
            color: $color-white-2;
            font-size: 2.4rem;
            text-decoration: none;
            transition: all .2s;

            @media(min-width: 768px) {
                font-size: 3.8rem;
            }

            span {
                margin-right: 1.5rem;
                display: inline-block;
            }

        }

        &:hover {
            color: $color-white-1;
            transform: scale(1.1);
        }
    }

    &__checkbox:checked~&__background {
        transform: scale(80)
    }

    &__checkbox:checked~&__nav {
        width: 100%;
        visibility: visible;
        opacity: 1;
    }

    &__icon {

        position: relative;
        margin-top: 2.5rem;


        @media (min-width: 768px) {
            margin-top: 3.5rem;
        }

        &,
        &::before,
        &::after {
            display: inline-block;
            width: 2.2rem;
            height: 2px;
            background-color: $color-black-1;

            @media (min-width: 768px) {
                width: 3rem;
            }

        }

        &::before,
        &::after {
            content: '';
            position: absolute;
            left: 0;
            transition: all 200ms;
        }

        &::before {
            top: -.8rem;
        }

        &::after {
            top: .8rem;
        }

    }

    &__button:hover &__icon::before {
        top: -1rem;
    }

    &__button:hover &__icon::after {
        top: 1rem;
    }

    &__checkbox:checked+&__button &__icon {
        background-color: transparent;
    }

    &__checkbox:checked+&__button &__icon::before {
        top: 0;
        transform: rotate(135deg);
    }

    &__checkbox:checked+&__button &__icon::after {
        top: 0;
        transform: rotate(-135deg);
    }


}

sources.scss/components/_popup.scss:
.popup {

    position: fixed;
    top: 0;
    left: 0;
    height: 100vh;
    min-height: 500px;
    width: 100vw;
    background-color: rgba($color-black, .8);
    border-radius: 3px;
    text-align: center;
    z-index: 400;
    opacity: 0;
    visibility: hidden;
    transition: all .3s;

    &:target {
        opacity: 1;
        visibility: visible;
    }

    &__close {
        &:link, 
        &:visited {
            position: absolute;
            top: -2rem;
            right: .5rem;
            display: inline-block;
            color: $color-black-1;
            font-size: 5.5rem;
            font-weight: 100;
            text-decoration: none;
            transition: all .3s;
        }

        &:hover {
            color: $color-black-0;
        }
    }

    &__right {
        font-size: 1.7rem;
        width: 80%;
        max-width: 1000px;
        height: auto;
        @include center;
        background:$color-white; 
        box-shadow: 0 1rem 2rem rgba($color-black, .8);
        border-radius: 3px;

        @media(min-width: 768px) {
            font-size: 2.3rem;
        }

        h2 {
            margin: 2.5rem 0 1rem 0;
            @media (min-width: 768px) {
                margin: 5rem 0;
            }
        }

    }

    &__top {
        @media(max-width: 768px) {
            padding: 1rem;
        }
    }

    &__contact-info {
        background: $color-black-0;
        color: $color-white-2;
        margin-top: 2rem;

        padding: 2rem 1rem 1rem 1rem;
        @media (min-width: 768px) {
            padding: 5rem 0 4rem 0;
            margin-top: 6rem;
        }

        ul {
            padding-bottom: 0;
        }

        a {
            color: $color-white-2 !important;
            text-decoration: none;
        }
    }

}

